with open('multimi.in', 'r') as f, open('multimi.out', 'w') as out:
    n = int(f.readline())
    st = set()
    for i in range(n):
        a, b = (int(x) for x in f.readline().split())
        st = st.intersection(set(range(a, b + 1))) if st else set(range(a, b + 1))
    if not st: out.write('multimea vida')
    else: out.write(' '.join(str(x) for x in sorted(st)))
